window.bookSummaryJSON = "<p>Book two in the Amazon best-selling Demigods of San Francisco series! </p> <p>I've agreed to work for a Demigod. My job? Find the spirit of his mother and release her before his vengeful father finds out and kills us all. </p> <p>Have I lost my mind? </p> <p>Thankfully, I don't have to do it alone. Kieran has brought in help. </p> <p>Bria Stevens is everything I'm not - magically savvy, edgy, and highly experienced. She's a Necromancer who loves to flirt with danger. With her help, I can suss out the clues surrounding the spirit of Kieran's mom, all while learning my potent and extremely terrifying magic. </p> <p>But as we work deeper into magical San Francisco, we uncover a minefield waiting to explode. A small misstep will have Valens at our doors. I'm about to find out that there are far worse things than mere death.</p>"; 
